        return false;
    if (lhs.tile_size < rhs.tile_size)
        return true;
    if (rhs.tile_size < lhs.tile_size)
        return false;
    if (lhs.tiling_rect < rhs.tiling_rect)
        return true;
    if (rhs.tiling_rect < lhs.tiling_rect)
        return false;
    if (lhs.tiles < rhs.tiles)
        return true;
    if (rhs.tiles < lhs.tiles)
        return false;
    return false;
